//整圆atan
float atan2(float y, float x){
    if(x>0.0){
        return atan(y/x);
    }
    else if(x<0.0){
        if(y>=0.0){
            return atan(y/x) + PI;
        }else{
            return atan(y/x) - PI;
        }
    }
    else{// x==0
        return sign(y) * PI / 2.0;
    }
}

//根据normal获取天空的UV
vec2 skyUV(vec3 normal) {
    vec2 uv;
    float phi = atan2(normal.z, normal.x);
    float theta = asin(normal.y);
    uv.x = 1.0 - (phi + PI) / (2.0 * PI);
    uv.y = (theta + PI/2.0) / PI;
    uv.y = 1.0 - uv.y;
    return uv;
}

